So, what's wrong with this?
Here it is;
Everyday, normal people don't have the eyes and ears of millions of people that listen to them. The bigger the audience that an entity has, the more cautious it should be. The message of this film has already been put out that Republicans are less than human. It's called stochastic terrorism. People do and should discredit any entity promoting destructive behavior, actions and ideas. We all know what they are doing and if you don't or didn't, you do now. Words and actions have consequences, saying otherwise is willful ignorance at best. It should be criminally culpable but it's not. There's no way to prove that a certain entity caused anything  but we know it happens. Any famous person that commits suicide, a spike in suicides and attempted suicides follows. So to these filmmakers I say a hearty, "fuck you."
